import React from 'react';
import Navbar from '../navbar';
import './shop.css'


function Allproduct() {



  return (
   <div className="shoppage">
         <header className='shoppageheader'>
               <Navbar/>
               <div className="shopheaderbox">

               </div>
         </header>

          <Container>

          <Newsletter/>
          </Container>

           <Footer/>
   </div>
  );
}

export default  Allproduct;
